import React from "react";
import UserService from "../services/users.service";

class UserComponent extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            user : {
                firstName : '',
                lastName : '',
                userCredentials : {
                    username : '',
                    password : ''
                },
                email : '',
                phoneNumber: ''
            }
        }
    }

    componentDidMount() {
        UserService.get(1).then((response) => {
            this.setState({ user : response.data });
        });
    }

    render() {
        return(
            <div>
                <h1> Users </h1>
                {
                    this.state.user.map(
                        user =>
                        <div key = {user.id}>
                        <p> { user.id } </p>
                        <p> { user.firstName } </p>
                        <p> { user.lastName } </p>
                        <p> { user.userCredentials.username } </p>
                        <p> { user.userCredentials.password } </p>
                    </div>
                    )

                    // this.state.users.map (
